import React, { useState, useRef, useCallback } from "react";
import { BtnStoreCancel } from "./../../services/BtnStoreCancel";
import { Toast } from "primereact/toast";
import { BtnDropDown } from "../../services/BtnDropDown";

import { FormFeld } from "../../services/FormFeld";

export function MitgliedEditForm({
  modusNeuePerson,
  onSpeichern,
  onAbbruch,
  person,
  vereine,
}) {
  const toast = useRef(null);

  const member = person[0];

  const createUpdatePerson = useCallback(() => {
    if (personName.length === 0 || personVorname.length === 0) {
      toast.current.show({
        severity: "warn",
        summary: "Achtung",
        detail: "mindestens Name und Vorname m체ssen eingegeben werden!",
        life: 3000,
      });
    } else {
      const neuePerson = {
        Pers_Name: personName,
        Pers_Vorname: personVorname,
        NameGesamt: personName + ", " + personVorname,
        Pers_GebDat: personGebDat,
        Pers_Sex: personSex,
        Pers_Strasse: personStrasse,
        Pers_PLZ: personPLZ,
        Pers_Ort: personOrt,
        Pers_TelefonFestnetz: personTelFestnetz,
        Pers_TelelefonMobil: personTelMobil,
        Pers_EMail: personEmail,
        Pers_Status: personStatus,
        Pers_StatusDatum: personStatusDatum,
        Pers_Bank: personBank,
        Pers_IBAN: personIBAN,
        Pers_BIC: personBIC,
      };
      onSpeichern(neuePerson);
    }
  });

  let personNameTemp = "";
  let personVornameTemp = "";
  let personGebDatTemp = "";
  let personSexTemp = "";
  let personStrasseTemp = "";
  let personPLZTemp = "";
  let personOrtTemp = "";
  let personTelFestnetzTemp = "";
  let personTelMobilTemp = "";
  let personEmailTemp = "";
  let personStatusTemp = "";
  let personStatusDatumTemp = "";
  let personBankTemp = "";
  let personIBANTemp = "";
  let personBICTemp = "";

  if (!modusNeuePerson) {
    for (const property in member) {
      switch (String(property)) {
        case "Pers_Name":
          personNameTemp = member[property];
          break;
        case "Pers_Vorname":
          personVornameTemp = member[property];
          break;
        case "Pers_GebDat":
          personGebDatTemp = member[property];
          break;
        case "Pers_Sex":
          personSexTemp = member[property];
          break;
        case "Pers_Strasse":
          personStrasseTemp = member[property];
          break;
        case "Pers_PLZ":
          personPLZTemp = member[property];
          break;
        case "Pers_Ort":
          personOrtTemp = member[property];
          break;
        case "Pers_TelefonFestnetz":
          personTelFestnetzTemp = member[property];
          break;
        case "Pers_TelefonMobil":
          personTelMobilTemp = member[property];
          break;
        case "Pers_EMail":
          personEmailTemp = member[property];
          break;
        case "Pers_Status":
          personStatusTemp = member[property];
          break;
        case "Pers_StatusDatum":
          personStatusDatumTemp = member[property];
          break;
        case "Pers_Bank":
          personBankTemp = member[property];
          break;
        case "Pers_IBAN":
          personIBANTemp = member[property];
          break;
        case "Pers_BIC":
          personBICTemp = member[property];
          break;
        default:
          //console.log("Feld nicht zugewiesen");
          break;
      }
    }
  }
  const [personName, setPersonName] = useState(personNameTemp);
  const [personVorname, setPersonVorname] = useState(personVornameTemp);
  const [personGebDat, setPersonGebDat] = useState(personGebDatTemp);
  const [personSex, setPersonSex] = useState(personSexTemp);
  const [personStrasse, setPersonStrasse] = useState(personStrasseTemp);
  const [personPLZ, setPersonPLZ] = useState(personPLZTemp);
  const [personOrt, setPersonOrt] = useState(personOrtTemp);
  const [personTelFestnetz, setPersonTelFestnetz] = useState(
    personTelFestnetzTemp
  );
  const [personTelMobil, setPersonTelMobil] = useState(personTelMobilTemp);
  const [personEmail, setPersonEmail] = useState(personEmailTemp);
  const [personStatus, setPersonStatus] = useState(personStatusTemp);
  const [personStatusDatum, setPersonStatusDatum] = useState(
    personStatusDatumTemp
  );
  const [personBank, setPersonBank] = useState(personBankTemp);
  const [personIBAN, setPersonIBAN] = useState(personIBANTemp);
  const [personBIC, setPersonBIC] = useState(personBICTemp);

  const [verein, setVerein] = useState([]);

  console.log(vereine);

  return (
    <>
      <Toast ref={toast} />
      <div className="grid m-auto w-11">
        {FormFeld(personName, "Name", false, setPersonName)}
        {FormFeld(personVorname, "Vorname", false, setPersonVorname)}
        {FormFeld(personGebDat, "Geburtsdatum", false, setPersonGebDat)}
        {FormFeld(personSex, "Sex", false, setPersonSex)}
        {FormFeld(personStrasse, "Strasse", false, setPersonStrasse)}
        {FormFeld(personPLZ, "PLZ", false, setPersonPLZ)}
        {FormFeld(personOrt, "Ort", false, setPersonOrt)}
        {FormFeld(personTelFestnetz, "Telefon", false, setPersonTelFestnetz)}
        {FormFeld(personTelMobil, "Mobil", false, setPersonTelMobil)}
        {FormFeld(personEmail, "E-Mail", false, setPersonEmail)}
        {FormFeld(personStatus, "Status", false, setPersonStatus)}
        {FormFeld(personStatusDatum, "S-Datum", false, setPersonStatusDatum)}
        {FormFeld(personBank, "Bank", false, setPersonBank)}
        {FormFeld(personIBAN, "IBAN", false, setPersonIBAN)}
        {FormFeld(personBIC, "BIC", false, setPersonBIC)}
        <BtnDropDown
          label={"Verein"}
          labelPlaceholder={"Verein ausw채hlen"}
          selectedItem={verein}
          items={vereine}
          setSelectedItem={setVerein}
        />
      </div>
      <BtnStoreCancel
        createUpdate={createUpdatePerson}
        onAbbruch={onAbbruch}
      />
    </>
  );
}
